import React from "react";
import BodyContainer from "./BodyContainer";
import FlexBox from "./FlexBox";

const Footer = () => {
    const footerMenu = [
        {
            title: "서비스 소개",
        },
        {
            title: "개인정보 처리방침",
        },
        {
            title: "이용약관",
        },
    ];

    return (
        <BodyContainer className="footer border-t-[1px]">
            <FlexBox align="start" className="flex-col md:items-center py-[30px] color-gray-c7">
                <FlexBox align="center" className={"gap-3 pb-1 "}>
                    {footerMenu.map((item, index) => (
                        <>
                            <button>{item.title}</button>
                            {footerMenu.length - 1 !== index && (
                                <div className="h-[14px] w-[1px] bg-[#c7c9cd]" />
                            )}
                        </>
                    ))}
                </FlexBox>
                <div> Copyright 2024 Team independe All rights reserved.</div>
            </FlexBox>
        </BodyContainer>
    );
};

export default Footer;
